import { PrismaClient } from '@prisma/client'

const prisma = new PrismaClient();

async function main() {
  const alice = await prisma.user.upsert({
    where: { email: 'alice@prisma.io' },
    update: {},
    create: {
      email: 'alice@prisma.io',
      name: 'Alice',
    },
  })

  const gonza = await prisma.user.upsert({
    where: { email: 'gonzalo@prisma.io' },
    update: {},
    create: {
      email: 'gonzalo@prisma.io',
      name: 'Gonza',
    },
  })

  const products = await prisma.product.createMany({
    data: [{
      name: 'Play station',
      price: 433.3,
      description: 'Play Station 5 1024 gb silver',
      image: 'data:image/jpeg;base64,',
      userId: alice.id,
    },
    {
      name: 'Iphone 12',
      price: 433.3,
      description: 'Iphone 12 1024 gb silver',
      image: '',
      userId: alice.id,
    },
    {
      name: 'Oculus Quest 2',
      price: 1230.3,
      description: 'Oculus Quest 2 is our most advanced all-in-one VR system yet. Every aspect of the Quest 2 has been engineered for maximum performance, including optics, hardware, software, and comfort. No PC or console required. Just set up the Quest 2 with the Oculus app, and youre free to explore VR from almost anywhere.',
      image:'',
      userId: alice.id,
      },
      {
        name: 'Oculus Quest 2',
        price: 1230.3,
        description: 'Oculus Quest 2 is our most advanced all-in-one VR system yet. Every aspect of the Quest 2 has been engineered for maximum performance, including optics, hardware, software, and comfort. No PC or console required. Just set up the Quest 2 with the Oculus app, and youre free to explore VR from almost anywhere.',
        image:'',
        userId: gonza.id,
      },
      {
        name: 'Oculus Quest 2',
        price: 1230.3,
        description: 'Oculus Quest 2 is our most advanced all-in-one VR system yet. Every aspect of the Quest 2 has been engineered for maximum performance, including optics, hardware, software, and comfort. No PC or console required. Just set up the Quest 2 with the Oculus app, and youre free to explore VR from almost anywhere.',
        image:'',
        userId: gonza.id,
      },
    ]
  })

  console.log('Products created:', products.count)
}

main()
  .then(async () => {
    await prisma.$disconnect()
  })
  .catch(async (e) => {
    console.error(e)
    await prisma.$disconnect()
    process.exit(1)
  })
